import styled from "styled-components";

const LoaderContainer = styled.div`
  width: 400px;
  height: 400px;
  display: flex;
  border: 10px solid red;
`;

const LoaderItem = styled.div`
  border: 16px solid red;
  border-radius: 50%;
`;

const Loader = () => {
  return <LoaderContainer />;
};

export default Loader;
